import React, { useEffect, useState } from "react";
import axios from "axios";
function Doctprofile() {
    const [person, setperson] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:5000/doctor")
            .then(res => {
                setperson(res.data);
            });
    }, [])
    return (
        <div class="container">
            {person.map((persons) => (
                <div class="card cr" style={"width: 18rem;"}>
                    <div class="card-body">
                        <table class="table" style="font-weight: bold;">
                            <tbody>
                                <tr>
                                    <td>Full Name</td>
                                    <td>{persons.name}</td>
                                </tr>
                                <tr>
                                    <td>Specialised</td>
                                    <td>{persons.Specialised}</td>
                                </tr>
                                <tr>
                                    <td>Hours Work</td>
                                    <td>{persons.hourwork}</td>
                                </tr>
                            </tbody>
                        </table>
                    </div>
                </div>
            ))}
        </div>
    );
}


export default Doctprofile;
